import React from "react";
import { useSelector } from "react-redux";
import "../styles/table.css";

function Table() {
    const notebooks = useSelector((state) => state.dataReducer.notebooks);
    const parameters = useSelector((state) => state.dataReducer.parameters);

    return (
        <div className="table-wrap">
            <table
                cellPadding="10"
                cellSpacing="1"
                border="2"
                bgColor="#c5c5c5"
                className="table-notebooks"
            >
                <thead>
                    <tr>
                        <th></th>
                        {parameters.map((parameter) => (
                            <th className="title-column" key={parameter}>
                                {parameter}
                            </th>
                        ))}
                    </tr>
                </thead>
                <tbody>
                    {notebooks.map((notebook, index) => (
                        <tr key={index - 1}>
                            <th key={index}>{notebook.name}</th>
                            <td key={index + 1}>{notebook.resolution}</td>
                            <td key={index + 2}>{notebook.year}</td>
                            <td key={index + 3}>{notebook.memory}</td>
                            <td key={index + 4}>{notebook.screen}</td>
                            <td key={index + 5}>{notebook.RAM}</td>
                            <td key={index + 6}>{notebook.disk}</td>
                            <td key={index + 7}>{notebook["CPU frequency"]}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default Table;
